jQuery.extend(jQuery.roundabout_shape,{theJuggler:function(t,a,h){return{x:Math.sin(t+a),y:Math.tan(Math.exp(Math.log(t))+a)/(h-1),z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},figure8:function(t,a,h){return{x:Math.sin(2*t+a),y:Math.sin(t+Math.PI/2+a)/8*h,z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},waterWheel:function(t,a,h){return{x:Math.sin(t+Math.PI/2+a)/8*h,y:Math.sin(t+a)/(Math.PI/2),z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},square:function(t,a,h){var M,n,s;return t<=Math.PI/2?(M=2/Math.PI*t,n=-(2/Math.PI)*t+1,s=-(1/Math.PI)*t+1):t>Math.PI/2&&t<=Math.PI?(M=-(2/Math.PI)*t+2,n=-(2/Math.PI)*t+1,s=-(1/Math.PI)*t+1):t>Math.PI&&t<=3*Math.PI/2?(M=-(2/Math.PI)*t+2,n=2/Math.PI*t-3,s=1/Math.PI*t-1):(M=2/Math.PI*t-4,n=2/Math.PI*t-3,s=1/Math.PI*t-1),{x:M,y:n*h,z:s,scale:s}},conveyorBeltLeft:function(t,a,h){return{x:-Math.cos(t+a),y:Math.cos(t+3*Math.PI/2+a)/8*h,z:(Math.sin(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},conveyorBeltRight:function(t,a,h){return{x:Math.cos(t+a),y:Math.cos(t+3*Math.PI/2+a)/8*h,z:(Math.sin(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},goodbyeCruelWorld:function(t,a,h){return{x:Math.sin(t+a),y:Math.tan(t+3*Math.PI/2+a)/8*(h+.5),z:(Math.sin(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},diagonalRingLeft:function(t,a,h){return{x:Math.sin(t+a),y:-Math.cos(t+Math.tan(Math.cos(a)))/(h+1.5),z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},diagonalRingRight:function(t,a,h){return{x:Math.sin(t+a),y:Math.cos(t+Math.tan(Math.cos(a)))/(h+1.5),z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},rollerCoaster:function(t,a,h){return{x:Math.sin(t+a),y:Math.sin((2+h)*t),z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}},tearDrop:function(t,a,h){return{x:Math.sin(t+a),y:-Math.sin(t/2+h)+.35,z:(Math.cos(t+a)+1)/2,scale:Math.sin(t+Math.PI/2+a)/2+.5}}});